import React from "react";

class DisplayInfor extends React.Component {
    render() {
        const { listUsers } = this.props;

        return (
            <div>
                {listUsers.map((user) => {
                    return (
                        <div key={user.id}>
                            <div>My name is {user.name}</div>
                            <div>Age: {user.age}</div>
                        </div>
                    );
                })}
            </div>
        );
    }
}

export default DisplayInfor;
